data.value:
Принцип формирования строки в отчет аналогичен, например, 
формированию заголовков в медиа-проигрывателе Winamp.
Программа находит определенные последовательности, и вместо
переменных подставляет значения для обрабатываемой раздачи.
Всё остальное - копируется без изменений.
Индексы букв, составляющих название переменной, значения не имеют.
Список обрабатываемых переменных:

==Свойства, полученные из торрент-клиентов==
%Hash% - хэш раздачи;
%Status% - статус раздачи - число;
%Name% - имя раздачи в торрент-клиенте;
%Label% - метка раздачи;
%Size% - размер раздачи в байтах;
%TorrentQueueOrder% - № в списке загрузки (если "-1" это значит сидируется);
%PercentProgress% - процент загрузки раздачи (в промилле);
%Downloaded% - количество загруженных байт;
%Uploaded% - количество отданных байт;
%Ratio% - рейтинг (в промилле);
%UploadSpeed% - текущая скорость отдачи, байт/сек;
%DownloadSpeed% - текущая скорость закачивания, байт/сек;
%ETA% - оставшееся время до конца загрузки;
%PeersConnected% - количество присоединившихся пиров;
%PeersInSwarm% - пиров всего;
%SeedsConnected% - количество присоединившихся сидов;
%SeedsInSwarm% - сидов всего;
%Availability% - доступность (100% = 65536 долей);
%Remaining% - сколько байт осталось загрузить;

==при использовании торрент-клиента Transmission==
%DownloadDir% - папка, в которую загружаются файлы раздачи. Это можно и в utorrent выяснить, но это отдельный запрос к каждой раздаче. Кому надо - пишите, добавлю. Там много чего можно выяснять.

==Свойства, полученные из торрент-файла==
%Filename% - Полный путь к торрент-файлу совпадающим хэшем
%CommentText% - комментарий из торрент-файла (в нём - веб-адрес к раздаче)

==Свойства, полученные с сайта==
%Web_NameFromWeb% - Название раздачи, полученное из веб-страницы
%Web_PeersFromSite% - количество личей, полученное из веб-страницы
%Web_SeedsFromSite% - количество сидов, полученное из веб-страницы
%Web_AddressNumber% - Номер раздачи, т.е. число в веб-адресе раздачи, идущее после знака равенства
%Web_SubforumNumber% - Номер подраздела, к которому принадлежит данная раздача
%Web_Status% - Статус раздачи, т.е. значки: "*", "%", "&radic;", "?", "!", "D", "&copy;", "x", "T", "&sum;", "#", "&#8719;"
%Web_SizeKMGBytes% - размер раздачи (копия текста из веб-страницы)
%Web_FullSource% - для раздач с нулевым количеством сидов определяем, когда сид был последний раз
%Web_TorrentFileAddress% - веб-адрес  торрент-файла
%Web_torrentRegistered% - дата и время регистрации торрент-файла на трекере
%Web_torrentRegisteredUNIXTime% - UNIX-время регистрации торрент-файла на трекере (т.е. кол-во секунд, прошедшее с 1970-янв-01 00:00:00)
